@BlogdoNoblat

A prioridade máxima na campanha de Bolsonaro é fazer tudo ao seu alcance para aumentar a abstenção onde Lula foi vem votado. E fazer tudo significa: jogar fora das quatro linhas da Constituição. Vi Collor fazer isso em 1989, e se elegeu. E, perto de Bolsonaro, Collor era um bobo.


 Bom dia Denunciei isso lá no 1° turno e quase perdi a conta e fui perseguido por isso. Mas a verdade é essa daí. Lula só não venceu no 1° turno porque forjaram uma abstenção na marra nas áreas onde Lula tem mais votos e existe maior fragilidade social e condição de coibir ações. O TSE nada fez. Se assim se repetir e se ampliar no 2° turno iremos entrar em uma ditadura neste país. É necessário agir com todas as forças para proteger o povo e garantir q todos possam votar sem coação, ameaças, sabotagem, subornos e terrorismo eleitoral. Os mesários bolsonaristas continuam lá. O TSE nada fez para isso é pouco está fazendo contra as fake News direcionada aos aposentados, mais pobres e pessoas necessitadas. O desgoverno continua abrindo os cofres para comprar votos via orçamento secreto e os benefícios ilegais na boca da urna e o STF ignora. É um uso da máquina é uma sujeira nunca antes vista na nossa história. Temos que agir logo. Depois não adianta ficar choramingando como foi no golpe, na prisão do Lula e na eleição deste genocida. Fingiram q não sabiam e agora não tem como fingir, tudo está aí na luz do dia e fede para todos sentirem. É uma luta curto de 12 dias que irão valer por toda nossa história e o futuro de todas as gerações. Vamos ser conhecidos por permitir o capítulo mais vergonhoso ele trágico do Brasil ou por vencer e impedir um desastre? A luta é agora!
